C Famous difficult cases in Fortran syntax
      INTEGER FORMAT(10),H3
      DO10I=1,10
      DO10I=1.10
 10   CONTINUE
      DOUBLE PRECISION I=1,10
      DOUBLE PRECISION I=1.10
      END DO
 1    format(3H)=(I9/I10)
 2    format(H3)=(I9/I10)
      end
      REALFUNCTIONF(M,N)
      REALFUNCTIONF(M,N)
      REALFUNCTIONF(M,N)=M+N
      FUNCTIONF(M,N)=M+N
      F=M+N
      END
